import React from 'react';
import Slider from 'react-slick';

const Testimonials = () => {
  return <Slider>
        <div className='testimonial py-4 px-3'>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae deserunt odit, amet, quidem voluptatum esse magni sequi nam repellendus facere delectus molestias praesentium nihil numquam eum laborum maiores atque harum.</p>
        </div>
  </Slider>
}

export default Testimonials
